  return (
    <div className="App">
      <h1 className='title'>To Do List</h1>
      <div className='input_block'>
      <input type='text' className='input_first'></input>
      </div>
      <div className='input_block'>
      <input type='text' className='input_second'></input>
      {/* <Button type="primary">Primary Button</Button> */}
      </div>
    </div>
  )
}

export default App;
